import mapboxgl, { AnyLayer, EaseToOptions, IControl, Map } from "mapbox-gl";
import { changeSvgColor, Dict } from "../utils";

//#region img_satellite & img_base
const img_satellite = `data:image/png;base64,`;

const img_base = `data:image/png;base64,`;

//#endregion

interface SwitchItemOption {
  /**
   * 切换图层显示的名称
   */
  name?: string

  /**
   * 显示的名称颜色
   */
  textColor?: string,

  /**
   * 背景图片 
   */
  backgroundImage?: string,
}

export interface SwitchLayerItem {

  /**
   * 图层显示名称
   */
  name: string,

  /**
   * 图层
   */
  layer: AnyLayer,

  /**
   * 平移参数，当不为空时，图层被激活显示后将自动移动到设计的位置
   */
  easeToOptions?: EaseToOptions,

  /**
   * 是否与其他的图层互斥
   */
  mutex?: boolean,

  /**
   * 是否初始显示
   */
  active?: boolean,

  /**
   * 背景图片
   */
  backgroundImage: string,

  /**
   * 当图层被激活显示时的回调
   * @param visible 
   * @returns 
   */
  onVisibleChange?: (visible: boolean) => void
}

export interface SwitchGroupLayers {

  /**
   * 图层组互斥
   */
  mutex?: boolean,

  layers: Array<SwitchLayerItem>
}

export interface SwitchMapExtraInfo {

  /**
   * 附加信息名字 默认：附加图层
   */
  name?: string;

  /**
   * 图钉被激活的颜色
   */
  nailActiveColor?: string,

  /**
   * 组容器最大高度
   */
  groupsContainerMaxHeight?: number,

  /**
   * 图层被激活显示时ui颜色
   */
  layerItemActiveColor?: string,

  /**
   * 图层hover颜色
   */
  layerItemHoverColor?: string,

  /**
   * 图层图片Div宽高
   */
  layerItemImgSize?: number,

  layerGroups?: Record<string, SwitchGroupLayers>;
}

export interface SwitchMapControlOptions {
  baseOption?: SwitchItemOption,
  satelliteOption?: SwitchItemOption,
  extra?: SwitchMapExtraInfo
}

export default class SwitchMapControl implements IControl {

  private nailImg = `<svg t="1673283468858" class="icon" viewBox="0 0 1024 1024" version="1.1" xmlns="http://www.w3.org/2000/svg" p-id="2736" data-darkreader-inline-fill="" width="22" height="22">
  <path d="M912.9 380.2L643.5 110.9c-12.1-12.1-29.6-15.8-45.6-9.8s-26.6 20.5-27.6 37.6l-4.9 83.7-299.1 199.4-112.6-5.4c-17.8-0.7-34 9.2-41.3 25.5s-3.7 35 8.9 47.7L314.7 683 102.5 895.2c-7.2 7.2-7.2 18.8 0 26 3.6 3.6 8.3 5.4 13 5.4s9.4-1.8 13-5.4L340.7 709l193.4 193.4c8.3 8.3 19.1 12.6 30.2 12.6 5.9 0 11.8-1.2 17.4-3.7 16.3-7.2 26.3-23.4 25.5-41.3l-5.4-112.6 199.5-299.2 83.7-4.9c17.1-1 31.5-11.6 37.6-27.6s2.4-33.4-9.7-45.5z m-24.6 32.5c-0.5 1.4-1.9 3.7-5.4 3.9l-85.2 5-135.3-135.3c-7.2-7.2-18.8-7.2-26 0s-7.2 18.8 0 26l130.9 130.9-187.5 281.2-223.7-223.7c-7.2-7.2-18.8-7.2-26 0s-7.2 18.8 0 26l225.1 225.1c2.8 2.8 6.3 4.5 9.9 5.1l5.5 114.9c0.2 3.5-1.9 5.1-3.6 5.9-1.7 0.8-4.4 1.2-6.8-1.3L147.3 463.6c-2.5-2.5-2-5.1-1.3-6.8 0.8-1.7 2.5-4 5.9-3.6l118.6 5.6c3.9 0.2 7.8-0.9 11.1-3.1l311.9-207.9c4.8-3.2 7.8-8.5 8.2-14.2l5.5-92.8c0.2-3.5 2.6-4.8 3.9-5.4 1.4-0.5 4.1-1 6.5 1.4l269.3 269.3c2.4 2.5 1.9 5.2 1.4 6.6z" fill="#2D3742" p-id="2737" data-darkreader-inline-fill="" style="--darkreader-inline-fill:#0d1722;">
  </path></svg>`;

  private layerContainerDivShowAlways = false;

  constructor(private options: SwitchMapControlOptions = {}) {
    options.baseOption ??= {};
    options.baseOption.name ??= '电子地图';
    options.baseOption.textColor ??= 'black';
    options.baseOption.backgroundImage ??= img_base;

    options.satelliteOption ??= {};
    options.satelliteOption.name ??= '卫星影像';
    options.satelliteOption.textColor ??= 'black';
    options.satelliteOption.backgroundImage ??= img_satellite;

    if (options.extra) {
      options.extra.name ??= '附加图层';
      options.extra.nailActiveColor ??= "#0066FF";
      options.extra.groupsContainerMaxHeight = 300;

      options.extra.layerItemActiveColor ??= "#0066FF";
      options.extra.layerItemHoverColor ??= "black";
      options.extra.layerItemImgSize ??= 50;
    }
  }

  onAdd(map: Map): HTMLElement {

    map.addLayer({
      id: "mapbox-satellite",
      type: "raster",
      source: {
        type: 'raster',
        tiles: [`https://api.mapbox.com/v4/mapbox.satellite/{z}/{x}/{y}.png?sku=${mapboxgl.accessToken}`],
        tileSize: 256
      },
      layout: {
        visibility: 'none'
      }
    })

    const baseDiv = this.createBaseLayerDiv(map);

    const extraLayers = this.options.extra?.layerGroups;
    if (extraLayers && Object.getOwnPropertyNames(extraLayers).length > 0) {

      const { containerDiv, groupsDiv } = this.createGroupLayerContainerDiv();
      const layerIdMap = new Dict<string, SwitchLayerItem>();

      for (let groupName in extraLayers) {
        const { layers, mutex } = extraLayers[groupName];
        const { groupDiv, layerDiv } = this.createGroupLayerDiv(groupName);

        let onceLayerActiveMutex = false;

        layers.forEach(item => {

          // 检查互斥active
          if (item.active && onceLayerActiveMutex)
            throw new Error("exsit mutex layer active at same time!");
          if ((item.mutex || mutex) && item.active) {
            onceLayerActiveMutex = true;
          }

          // 重复id检查
          if (layerIdMap.has(item.layer.id))
            throw new Error(`same layer id : ${item.layer.id} added !`);
          else
            layerIdMap.set(item.layer.id, item);

          layerDiv.append(this.createGroupLayerItemDiv(map, item, groupName, mutex || item.mutex));
        })

        groupsDiv.append(groupDiv);
      }

      baseDiv.append(containerDiv);
      baseDiv.addEventListener('mouseover', e => {
        containerDiv.style.pointerEvents = 'auto';
      })
    }

    return baseDiv;
  }

  onRemove(map: Map): void {

  }
  getDefaultPosition() {
    return 'bottom-right'
  }

  /**
   * 基础图层切换
   * @param map 
   * @param extra 存在其他图层
   * @returns 
   */
  private createBaseLayerDiv(map: Map) {
    // 创建按钮
    const div = document.createElement('div');
    div.innerHTML = `<style>
    .jas-ctrl-switchmap .jas-ctrl-switchmap-alert {
      transition: 0.25s;
      opacity: 0;
    }

    .jas-ctrl-switchmap.alert-is-shown .jas-ctrl-switchmap-alert {
        transition: 0.25s;
        opacity: 1;
    }

    .jas-ctrl-switchmap-alert-groups::-webkit-scrollbar{
      width: 5px;
    }

    .jas-ctrl-switchmap-alert-groups::-webkit-scrollbar-thumb {/*滚动条里面小方块*/
        border-radius: 10px;
        -webkit-box-shadow: inset 0 0 5px rgba(0,0,0,0.2);
        background: #535353;
    }

    .jas-ctrl-switchmap-layer:hover{
      border: 2px solid ${this.options.extra?.layerItemHoverColor};
      box-sizing: border-box;
    }
    </style>` ;

    let style = div.style;
    const divSize = '89px';

    div.className = 'jas-ctrl-switchmap mapboxgl-ctrl mapboxgl-ctrl-group';
    style.cursor = 'pointer';
    style.height = divSize;
    style.width = divSize;
    style.margin = '0 10px 10px 0'
    style.borderRadius = '10px';
    style.pointerEvents = 'auto';
    style.display = 'flex';
    style.justifyContent = 'center';
    style.alignItems = 'flex-end';
    style.float = 'right';
    style.border = '2px solid rgba(0,0,0,0)';
    style.backgroundSize = divSize;

    // 创建文字
    const text_div = document.createElement('div');
    text_div.className = "jas-ctrl-switchmap-text";
    style = text_div.style;
    style.position = 'absolute';
    style.fontWeight = '500';
    style.letterSpacing = '2px';
    style.pointerEvents = 'none';
    style.marginBottom = '10px';
    div.append(text_div);

    const changeDiv = (option: SwitchItemOption) => {
      text_div.innerText = option.name!;
      text_div.style.color = option.textColor!;
      div.style.backgroundImage = `url("${option.backgroundImage}")`;
    }

    // 初始化
    changeDiv(this.options.satelliteOption!);

    div.addEventListener("click", () => {
      const satelliteVisibled = map.getLayoutProperty('mapbox-satellite', 'visibility') === 'visible';
      changeDiv(satelliteVisibled ? this.options.satelliteOption! : this.options.baseOption!);
      map.setLayoutProperty('mapbox-satellite', 'visibility', satelliteVisibled ? 'none' : 'visible');
    });

    div.addEventListener('mouseover', () => {
      div.style.border = '2px solid';

      if (!div.classList.contains('alert-is-shown'))
        div.classList.add('alert-is-shown');
    })

    div.addEventListener('mouseout', () => {
      div.style.border = '2px solid rgba(0,0,0,0)';

      if (div.classList.contains('alert-is-shown') && !this.layerContainerDivShowAlways)
        div.classList.remove('alert-is-shown');
    })

    return div;
  }

  private createGroupLayerContainerDiv(): { containerDiv: HTMLDivElement, groupsDiv: HTMLDivElement } {
    const headerHeight = 30;

    const containerDiv = document.createElement('div');
    let style = containerDiv.style;
    containerDiv.className = "jas-ctrl-switchmap-alert mapboxgl-ctrl-group";
    style.cursor = 'auto';
    style.right = "100px";
    style.backgroundColor = '#fff';
    style.position = 'absolute';
    style.zIndex = '10';
    style.pointerEvents = 'none';
    style.padding = '16px 24px';

    containerDiv.addEventListener('click', e => {
      e.stopPropagation()
    })

    containerDiv.addEventListener('mouseout', e => {
      if (!this.layerContainerDivShowAlways)
        containerDiv.style.pointerEvents = 'none';
    })

    const headerDiv = document.createElement('div');
    headerDiv.innerHTML = `<div>${this.options.extra?.name}</div>`;
    style = headerDiv.style;
    style.height = `${headerHeight}px`;
    style.display = 'flex';
    style.justifyContent = 'space-between';
    style.alignItems = 'center';
    style.fontSize = '16px';
    style.fontWeight = '500';
    style.borderBottom = '1px solid #ccc'
    const nailDiv = document.createElement('div');
    nailDiv.innerHTML = this.nailImg;
    nailDiv.style.cursor = 'pointer';
    headerDiv.append(nailDiv);

    nailDiv.addEventListener('click', () => {
      this.layerContainerDivShowAlways = !this.layerContainerDivShowAlways;
      changeSvgColor(nailDiv.children[0] as SVGAElement, this.layerContainerDivShowAlways ? this.options.extra!.nailActiveColor! : '#2D3742');
    });

    const groupsDiv = document.createElement('div');
    groupsDiv.classList.add('jas-ctrl-switchmap-alert-groups');
    style = groupsDiv.style;
    style.maxHeight = `${this.options.extra?.groupsContainerMaxHeight}px`;
    style.overflowY = 'auto';
    style.padding = '16px 8px 0 8px';

    containerDiv.append(headerDiv);
    containerDiv.append(groupsDiv);

    return { containerDiv, groupsDiv };
  }

  private createGroupLayerDiv(name: string): { groupDiv: HTMLDivElement, layerDiv: HTMLDivElement } {
    const groupDiv = document.createElement('div');
    let style = groupDiv.style;
    style.marginBottom = '24px';

    const header = document.createElement('div');
    header.innerHTML = `<span>${name}</span>`;
    style = header.style;
    style.display = 'flex';
    style.alignItems = 'flex-end';
    style.fontWeight = '500';
    style.fontSize = '14px';
    style.lineHeight = '20px';
    style.marginBottom = '16px';
    groupDiv.append(header);

    const layerDiv = document.createElement('div');
    style = layerDiv.style;
    style.display = 'grid';
    style.gridTemplateColumns = '1fr 1fr 1fr';
    style.gap = '20px 38px';
    style.justifyItems = 'center';
    style.minWidth = `${this.options.extra!.layerItemImgSize! * 3 + 38 * 2}px`


    groupDiv.append(layerDiv);

    return { groupDiv, layerDiv }
  }

  private createGroupLayerItemDiv(map: mapboxgl.Map, layerItem: SwitchLayerItem, group: string, mutex?: boolean): HTMLDivElement {
    const layerId = layerItem.layer.id;
    const lclass = 'jas-ctrl-switchmap-layer';
    const imgDivId = `${lclass}-${layerId}`;
    const textDivId = `${imgDivId}-text`;

    const container = document.createElement('div');
    let style = container.style;
    style.cursor = 'pointer'

    const imgDiv = document.createElement('div');
    imgDiv.className = lclass;
    imgDiv.id = imgDivId;
    style = imgDiv.style;
    style.height = `${this.options.extra?.layerItemImgSize}px`;
    style.width = `${this.options.extra?.layerItemImgSize}px`;
    style.boxShadow = '0 0 0 2px rgb(0 0 0 / 10%)';
    style.boxSizing = 'border-box';
    style.borderRadius = '4px';
    style.backgroundColor = 'white';
    style.backgroundSize = `${this.options.extra!.layerItemImgSize! - 4}px`;
    style.backgroundImage = `url('${layerItem.backgroundImage}')`;
    style.backgroundRepeat = 'no-repeat';
    style.backgroundPositionX = 'center';
    style.backgroundPositionY = 'center';
    style.margin = 'auto';
    container.append(imgDiv);

    const textDiv = document.createElement('div');
    textDiv.className = `${lclass}-text`;
    textDiv.id = textDivId;
    textDiv.innerText = layerItem.name;
    style = textDiv.style;
    style.textAlign = 'center';
    style.fontSize = '12px';
    style.lineHeight = '16px';
    style.marginTop = '4px';
    container.append(textDiv);

    const that = this;
    function setLayerVisibleAndChangeUI(item: SwitchLayerItem, imgDiv: HTMLElement | string, textDiv: HTMLElement | string, visible: boolean) {
      if (!map.getLayer(item.layer.id)) {
        map.addLayer(item.layer);
      }

      map.setLayoutProperty(item.layer.id, 'visibility', visible ? 'visible' : 'none');
      item.onVisibleChange?.call(undefined, visible);

      if (typeof imgDiv === 'string')
        imgDiv = document.querySelector(`#${map.getContainer().id} #${imgDiv}`)! as HTMLDivElement;

      if (typeof textDiv === 'string')
        textDiv = document.querySelector(`#${map.getContainer().id} #${textDiv}`)! as HTMLDivElement;

      imgDiv.style.border = visible ? `2px solid ${that.options.extra!.layerItemActiveColor!}` : '';
      textDiv.style.color = visible ? that.options.extra!.layerItemActiveColor! : '';
    }

    if (layerItem.active) {
      setLayerVisibleAndChangeUI(layerItem, imgDiv, textDiv, true);
    }

    container.addEventListener('click', e => {

      const toVisible = !map.getLayer(layerId) || map.getLayoutProperty(layerId, 'visibility') === 'none';

      // 设置layer显示或隐藏
      setLayerVisibleAndChangeUI(layerItem, imgDiv, textDiv, toVisible);

      if (toVisible) {

        if (layerItem.easeToOptions)
          map.easeTo(layerItem.easeToOptions);

        // 如果互斥设置同group中的layer隐藏
        this.options.extra!.layerGroups![group].layers.forEach(l => {
          const otherId = l.layer.id;

          if (otherId !== layerId && map.getLayer(otherId) && (mutex || l.mutex)) {
            setLayerVisibleAndChangeUI(l, `${lclass}-${otherId}`, `${lclass}-${otherId}-text`, false);
          }
        });
      }
    })

    return container;
  }
}